import { createBrowserRouter, useRouteError, useOutletContext } from "react-router-dom";
import App from './App';
import ComposeSalad from "./ComposeSalad";
import ViewOrder from "./ViewOrder";

const [salads, setSalads] = useOutletContext();
const router = createBrowserRouter([
  {
    element: <App />,
    children: [
      {
        path: "compose-salad",
        element: <ComposeSalad useOutletContext/>
      }, 
      {
        path: "view-order",
        element: <ViewOrder />
      }
    ]
  },
]);
export default router
